#Requires -Version 2

$Reflection = ""
$WinApiEnum = ""
$WinApiStruct = ""
$WinApiWrappers = ""
$WinApi = ""
$Helpers = ""
$Globals = ""
$Main = ""
$User = ""
$ServicesHelpers = ""
$Services = ""
$Applications = ""
$ScheduledTasks = ""
$HardeningHelpers = ""
$Hardening = ""
$ConfigurationHelpers = ""
$Configuration = ""
$Network = ""
$Updates = ""
$CredentialsHelpers = ""
$Credentials = ""
$Misc = ""
$MsiHelpers = ""

function ConvertFrom-Gzip {
    [CmdletBinding()]
    param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Reflection,$WinApiEnum,$WinApiStruct,$WinApiWrappers,$WinApi,$Helpers,$Globals,$Main,$User,$ServicesHelpers,$Services,$Applications,$ScheduledTasks,$HardeningHelpers,$Hardening,$ConfigurationHelpers,$Configuration,$Network,$Updates,$CredentialsHelpers,$Credentials,$Misc,$MsiHelpers)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    $Decompressed = ConvertFrom-Gzip -Bytes $Decoded
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decompressed)
    . $ScriptBlock
}
